class Solution(object):
	def maxVowels(self, s, k):
		"""
		:type s: str
		:type k: int
		:rtype: int
		"""
		vowels= "aeiou"
		counter = 0
		maxSub = -1
		i = 0
		j = 0
		subS = s[i:i + k]
		for j in range(len(subS)):
			if(subS[j] in vowels):
				counter += 1
		for i in range(len(s)): #it didnt pass with while loop but it did with for loop LOL :`)
			maxSub = counter if counter > maxSub else maxSub
			if(i+k == len(s)):
				break
			if(s[i] in vowels):
				counter -= 1
			if(i + k < len(s) and s[i+k] in vowels):
				counter += 1
			# i+=1
		return maxSub					   

s = ""

k = 3945
print(Solution().maxVowels(s,k))